import { Container, Modal,Button } from "react-bootstrap";

function Modal1(props) {

    const delData = () =>{
        props.deletech(props.datadel);
        props.setDataToDelClose()
        props.setdataToDel(null);
    }

  const handleModalContainerClick = (e) => e.stopPropagation();
  return (
    <Modal {...props} aria-labelledby="contained-modal-title-vcenter">
      <Modal.Header>
        <Modal.Title
          className="d-flex justify-content-between"
          id="contained-modal-title-vcenter"
        >
          <>
            <p>Elminar Chofer</p>
            <Button
              style={{ marginLeft: "auto" }}
              className="btn-fill "
              variant="danger"
              onClick={props.setDataToDelClose}
            >
              Cancelar
            </Button>
          </>
        </Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <Container>{props.children}</Container>
      </Modal.Body>
      <Modal.Footer>
        <Button
          style={{ marginLeft: "auto" }}
          className="btn-fill "
          variant="danger"
          onClick={props.setDataToDelClose}
        >
          Cancelar
        </Button>
        <Button
          style={{ marginLeft: "6px" }}
          className="btn-fill "
          variant="info"
          onClick={() => delData()}
        >
          Aceptar
        </Button>
      </Modal.Footer>
    </Modal>
  );
}
export default Modal1;
